webpackJsonp([3],{bZjN:function(module,exports){module.exports="00:02\xa0\n\n1\n\nHello {{name}},\n\n00:04\xa0\n\n2\n\nIf you\u2019ve made it here..\n\n00:07\xa0\n\n3\n\nThen congratulations!\n\n00:08\xa0\n\n4\n\nBecause this means that your archetype is the Outlaw!\n\n00:12\xa0\n\n5\n\nWhat does this actually mean?\n\n{{#displayImage}} {path:'images/archetype-icons/outlaw.png', fadeIn: true} {{/displayImage}}\n\n00:14\xa0\n\n6\n\nDon\u2019t worry, everything you need to know will be on this page.\n\n00:18\xa0\n\n7\n\nStick to the end of it...\n\n00:19\xa0\n\n8\n\nAnd I promise that you\u2019ll experience something truly magical.\n\n00:25\xa0\n\n9\n\nThe quiz that you\u2019ve just taken is designed to identify your archetype...\n\n00:30\xa0\n\n10\n\nA personality profile that\u2019s broken down your entire being...\n\n{{#displayImage}} {path:'images/archetype-icons/outlaw.png', fadeOut: true} {{/displayImage}}\n\n00:34\xa0\n\n11\n\nYour tendencies, your strengths, your past, and your future.\n\n00:39\xa0\n\n12\n\nYour archetype takes into account your gender, your marital status...\n\n00:43\xa0\n\n13\n\nHow you answered the quiz, and how long you took to get those answers.\n\n00:49\xa0\n\n14\n\nThat\u2019s right, {{name}}.\n\n00:52\xa0\n\n15\n\nYou can use the information to make astronomical changes\xa0in your life.\n\n00:56\xa0\n\n16\n\nYou\u2019ll be able to leverage on your strengths, improve on your weaknesses...\n\n01:01\xa0\n\n17\n\nAnd embark on the life that you\u2019ve always dreamed of.\n\n01:05\xa0\n\n18\n\nBut before we get to that...\n\n01:06\xa0\n\n19\n\nI want to share with you about your archetype, The Outlaw, and what it means.\n\n01:14\xa0\n\n20\n\n{{name}}, you truly are a unique individual.\n\n01:19\xa0\n\n21\n\nAnd I genuinely believe that this world needs more people like you.\n\n01:24\xa0\n\n22\n\nYou are a free-minded and free-spirited individual.\n\n01:28\xa0\n\n23\n\nNothing stands in your way and nothing controls your desires.\n\n01:32\xa0\n\n24\n\nYou are the true representation of what it really means to be the captain of your own ship.\n\n01:39\xa0\n\n25\n\nYou are different in that way, {{name}}.\n\n01:42\xa0\n\n26\n\nWhile the world walks in one direction, you have no qualms with going against it.\n\n01:47\xa0\n\n27\n\nThat\u2019s what makes you so special, {{name}}.\n\n01:52\xa0\n\n28\n\nYou\u2019re deeply sensitive when it comes to the social and environmental issues of the world.\n\n01:57\xa0\n\n29\n\nYou\u2019re able to empathize with anyone and everyone.\n\n02:01\xa0\n\n\xa030\n\nThat\u2019s because as an Outlaw, you are highly compassionate.\n\n02:05\xa0\n\n31\n\nYou put the needs of others before your own...\n\n02:08\xa0\n\n32\n\nAnd you\u2019re able to connect with strangers just as well as...\n\n02:11\xa0\n\n33\n\nyou\u2019re able to connect with your closest loved ones.\n\n02:16\xa0\n\n34\n\n{{name}}, you may not know it yet...\n\n02:20\xa0\n\n35\n\nBut you are more morally and ethically upright than others.\n\n02:23\xa0\n\n36\n\nYou hold your values and principles close to your heart...\n\n02:26\xa0\n\n37\n\nAnd you\u2019re always ready to stick to your guns.\n\n{{#displayImage}} {path:'images/script-images/globe.png', fadeIn: true} {{/displayImage}}\n\n02:30\xa0\n\n38\n\nThere is something else about you, {{name}}\u2026\n\n02:35\xa0\n\n39\n\nYou are the one who will ignite massive change in the world.\n\n{{#displayImage}} {path:'images/script-images/globe.png', fadeOut: true} {{/displayImage}}\n\n02:40\xa0\n\n40\n\n{{name}}, I\u2019m getting the sense that you\u2019re going to live a long, and happy life.\n\n02:48\xa0\n\n41\n\nAlthough success might not be at your feet right now,\n\n02:51\xa0\n\n42\n\nyour riches and\xa0fulfilment are merely waiting for you.\n\n02:57\xa0\n\n43\n\nBut there\u2019s something else, {{name}}.\n\n03:01\xa0\n\n44\n\nEven though you will triumph, your path to success will not come easy.\n\n03:07\xa0\n\n45\n\nYou must challenge yourself with trusting people.\n\n03:10\xa0\n\n\xa046\n\nBeing vulnerable can be an incredibly scary thought for you,\n\n03:14\xa0\n\n47\n\nbut it\u2019s important to take small steps towards the direction...\n\n03:19\xa0\n\n48\n\nAnd make a few minor mistakes along the way.\n\n03:22\xa0\n\n49\n\nThis can be applied to both your personal and work relationships.\n\n03:27\xa0\n\n50\n\n{{name}}, don\u2019t let that discourage you.\n\n03:31\xa0\n\n51\n\nIt never hurts to open up once in a while to a loved one, such as family or close friends.\n\n03:38\xa0\n\n52\n\nThe world can be a vicious place if you\u2019re standing alone; even if that thought doesn\u2019t scare you,\n\n03:45\xa0\n\n53\n\nit should definitely be something worth pondering about.\n\n03:48\xa0\n\n54\n\nThe world needs people like you to be in positions of power.\n\n\xa003:53\xa0\n\n55\n\nYou are the one who keeps the world grounded.\n\n03:56\xa0\n\n56\n\nYou do, however, need to understand that it\u2019s important for you...\n\n04:00\xa0\n\n57\n\nTo combat your cynicism by being more emotionally connected.\n\n04:05\xa0\n\n58\n\nThat way, you\u2019ll be able to build trust and create even more fruitful interactions.\n\n04:12\xa0\n\n59\n\nAfter all, {{name}}, the path to enlightenment and fulfilment lies within your hands.\n\n04:23\xa0\n\n60\n\n{{name}}, I can already tell that your friends and family really look up to you.\n\n04:29\xa0\n\n61\n\nYou\u2019re always ready to stand up for those in need, even if it means that...\n\n04:35\xa0\n\n62\n\nYou will be persecuted for your actions.\n\n04:40\xa0\n\n63\n\nYou\u2019re not the type of person to have huge circles of friends...\n\n04:43\xa0\n\n64\n\nBut you\u2019re not someone who has trouble with making friends.\n\n04:47\xa0\n\n65\n\nIn fact, you have no trouble at all when it comes to...\n\n04:50\xa0\xa0\n\n66\n\nimpressing others with your intelligence and passionate nature.\n\n04:54\xa0\n\n67\n\nYou are extremely selective with who you choose to let into your life.\n\n04:59\xa0\n\n68\n\nYou prefer to keep your loved ones close, and your wolf pack small.\n\n05:06\xa0\n\n69\n\n{{name}}, you are incredibly brave and find comfort in chaos.\n\n05:13\xa0\n\n70\n\nYou tend to struggle with being understood...\n\n05:16\xa0\n\n71\n\nBut you know deep down in your heart that your intentions are always centred...\n\n05:20\xa0\n\n72\n\nAround the greater good \u2013 even if your strategies and mannerisms speak otherwise.\n\n05:28\xa0\n\n73\n\n{{name}}, you are a natural-born leader.\n\n05:33\xa0\n\n74\n\nI sense that you will find success and fulfilment as an entrepreneur, an activist, or a philanthropist.\n\n05:41\xa0\n\n75\n\nYou can be very authoritative, {{name}}.\n\n05:46\xa0\n\n76\n\nYou tend to want things done your way, on your time...\n\n05:50\xa0\n\n77\n\nEven if your demands are exceedingly difficult to fulfil.\n\n05:54\xa0\n\n78\n\nNevertheless, {{name}}, you are going to make a lasting mark in your lifetime.\n\n06:02\xa0\n\n79\n\nYou\u2019re able to look at the world from a broad and altruistic perspective.\n\n06:06\xa0\n\n80\n\nYou see the big picture, and you have what it takes to make this world a better place.\n\n06:14\xa0\n\n81\n\n{{name}}, I sense that you despise systems and everything that comes with it...\n\n06:20\xa0\n\n82\n\nWhich is why you\u2019re constantly rebelling against authority.\n\n06:23\xa0\n\n83\n\nYou would do anything and everything you can to promote your own ways...\n\n06:29\xa0\n\n84\n\nAnd your own beliefs, which becomes clearly evident in your slightly destructive nature.\n\n06:37\xa0\n\n85\n\nUltimately, {{name}}, you are a visionary.\n\n06:42\xa0\n\n86\n\nYou have a clear idea of how you want to be in the world.\n\n06:45\xa0\n\n87\n\nYou do, however, tend to have difficulty discerning right from wrong.\n\n06:50\xa0\n\n88\n\nI\u2019m getting the sense that you\u2019re not too concerned about monetary riches...\n\n06:55\xa0\n\n89\n\nAlthough you do wish you had more wealth.\n\n06:58\xa0\n\n90\n\nThere is, however, a greater purpose for you in this lifetime, {{name}}.\n\n07:05\xa0\n\n91\n\nHowever, {{name}}, that can make you dependent on others for your own happiness.\n\n07:13\xa0\n\n92\n\nThat is something that you need to be careful of.\n\n07:17\xa0\n\n93\n\nAt times, it might feel as if you\u2019re living your life for others.\n\n07:22\xa0\n\n94\n\nThat\u2019s not what you want, {{name}}.\n\n07:26\xa0\n\n95\n\nYou want to live life for yourself. You want to love yourself.\n\n07:30\xa0\n\n96\n\nWhen you\u2019re able to do that, success and the life of your dreams will follow.\n\n07:35\xa0\n\n97\n\nAnd that\u2019s what Individuation aims to teach you.\n\n07:39\xa0\n\n98\n\nBut there\u2019s more to what I\u2019ve learned about you, {{name}}\u2026\n\n{{#displayImage}} {path:'images/script-images/spiritual.png', fadeIn: true} {{/displayImage}}\n\n07:43\xa0\n\n99\n\nIt feels to me that you\u2019re a deeply emotional and spiritual person.\n\n07:49\xa0\n\n100\n\nYou\u2019re connected to your soul in a way that\u2019s far more profound than others.\n\n07:54\xa0\n\n101\n\nYour thought process does not follow the rules and logic of the world.\n\n07:58\xa0\n\n102\n\nIn fact, I get the sense that you have quite the imagination.\n\n08:03\xa0\n\n103\n\nYour thoughts and dreams are vivid, colourful...\n\n08:06\xa0\n\n104\n\nAnd symbolic of who you are as an individual.\n\n{{#displayImage}} {path:'images/script-images/spiritual.png', fadeOut: true} {{/displayImage}}\n\n08:12\xa0\n\n105\n\n{{name}}, you\u2019re not someone who likes to argue.\n\n08:17\xa0\n\n106\n\nYou tend to avoid conflict and you\u2019re uncanny when it comes to devising win-win\xa0situations.\n\n08:23\xa0\n\n107\n\nBut when backed into a corner, you\u2019re not one to back down.\n\n08:28\xa0\n\n108\n\nYou fight fiercely for your loved ones and for righteousness.\n\n08:34\xa0\n\n109\n\nYou\u2019re the first person to step in when you see a fight breaking out.\n\n08:39\xa0\n\n110\n\nYou\u2019re the first person to reach for your pockets in the sight of a struggling busker.\n\n08:44\xa0\n\n111\n\nYou\u2019re the first person your friends call when they\u2019ve had a horrible day.\n\n08:49\xa0\n\n112\n\nYou\u2019re the one who people rely on and look up to.\xa0\n\n08:53\xa0\n\n113\n\n{{name}}, you are the role model\xa0for the world.\n\n08:58\xa0\n\n114\n\nBut every superhero needs a side-kick; a partner in crime.\n\n09:04\xa0\n\n115\n\nOne who will stick by them when the going gets tough. And the outlaw is no exception.\n\n{{#displayImage}} {path:'images/love-compatibility/outlaw-love-compatibility.png', fadeIn: true} {{/displayImage}}\n\n09:10\xa0\n\n116\n\nThis little chart I\u2019ve prepared represents the archetypes that you\u2019re most likely to\xa0end up with.\n\n09:16\xa0\n\n117\n\nOr if you\u2019re already in a committed relationship...\n\n09:19\xa0\n\n118\n\nThere\u2019s a real good chance that your spouse is one of those archetypes.\n\n09:25\xa0\n\n119\n\n{{name}}, you\u2019re not the kind of person that has trouble when it comes to love.\n\n09:31\xa0\n\n120\n\nPeople find themselves drawn to your charisma and kind nature.\n\n09:36\xa0\n\n121\n\nYou\u2019re sort of a rare breed when it comes to love.\n\n09:39\xa0\n\n122\n\nYou communicate better than anyone else...\n\n09:42\xa0\n\n123\n\nAnd you\u2019re an incredibly thoughtful individual.\n\n09:45\xa0\n\n124\n\nThe relationships that you forge with potential lovers are always profound and deep.\n\n09:53\xa0\n\n125\n\nYou become very selective with those who you choose to date...\n\n09:58\xa0\n\n126\n\nAnd who you choose to end up with \u2013 for good reason, of course.\n\n10:03\xa0\n\n127\n\nI sense that in the coming years...\n\n10:05\xa0\n\n128\n\nYou will be the happiest you\u2019ve ever been in that regard.\n\n10:12\xa0\n\n129\n\n{{name}}, I\u2019m sensing that your love life isn\u2019t going to be the smoothest...\n\n10:16\xa0\n\n130\n\nBut you will find that happiness that you\u2019re looking for soon enough.\n\n{{#displayImage}} {path:'images/love-compatibility/outlaw-love-compatibility.png', fadeOut: true} {{/displayImage}}\n\n10:23\xa0\n\n131\n\nBut don\u2019t forget, {{name}}, how you perceive yourself should not be determined by your love life.\n\n10:30\xa0\n\n132\n\nYour spouse or partner is meant to play a supporting role in your life; not the lead.\n\n10:38\xa0\n\n133\n\nFocus on your own personal growth...\n\n10:40\xa0\n\n134\n\nAnd I promise you, {{name}}...\n\n10:43\xa0\n\n135\n\nYou will soon discover heavenly rewards."}});
